import { MarkerMap } from '../../components/map/map';
import './pickUpPage.css'

export function PickUpPage() {
    return(
        <>
            <h4>Select Pick Up point</h4>
            <div className="where">
                <span>Where to?</span>
                <input name="myInput"/>
            </div>
            <MarkerMap/>
        </>
    );
}
